import React from "react";
import State from "./State";
import GasZTRPrice from "./GasZTRPrice";
import DaysMowedPerWeek from "./DaysMowedPerWeek";
import NumberNGBRUnits from "./NumberNGBRUnits";
import MowingHours from "./MowingHours";
import LengthMowingSeason from "./LengthMowingSeason";

const Inputs = ({
  setCustomerInputs,
  setPADDRegion,
  customerInputs,
  handleChange,
  handleClick,
  buttonClick,
  whichStep,
}) => {
  return (
    <div className="main container-inputs">
      <ul className="inputs" id="inputs">
        <li className="column states">
          <State
            {...{
              customerInputs,
              setCustomerInputs,
              handleChange,
              setPADDRegion,
              inStep: false,
              whichStep,
            }}
          />
        </li>
        <li className="column range with-output">
          <GasZTRPrice
            {...{
              customerInputs,
              setCustomerInputs,
              handleChange,
              inStep: false,
              whichStep,
            }}
          />
        </li>
        <li className="column range">
          <DaysMowedPerWeek
            {...{
              customerInputs,
              setCustomerInputs,
              handleChange,
              handleClick,
              inStep: false,
              whichStep,
            }}
          />
        </li>
        <li className="column range">
          <NumberNGBRUnits
            {...{
              customerInputs,
              handleChange,
              handleClick,
              inStep: false,
              whichStep,
            }}
          />
        </li>
        <li className="column">
          <MowingHours
            {...{
              customerInputs,
              handleChange,
              buttonClick,
              inStep: false,
              whichStep,
            }}
          />
        </li>
        <li className="column range">
          <LengthMowingSeason
            {...{
              customerInputs,
              handleChange,
              handleClick,
              inStep: false,
              whichStep,
            }}
          />
        </li>
      </ul>
    </div>
  );
};

export default Inputs;
